import Link from "next/link";
import styles from "./SideBarNav.module.css";

const SideBarNav = () => (
  <nav class={styles.sidebarcontainer}>
    <p class="p-3">brand name</p>
    <ul class="nav-links">
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/search">
        <a>Search</a>
      </Link>
    </ul>
  </nav>
);

export default SideBarNav;
